/**
 * Host side for the CEP Photoshop Extension GazeHelp
 * Created by Ryan Lewien
 * 746528
 * 
 * By interacting with the core parts of PhotoShop and creating windows with ScriptUI, 
 * this program interacts with the accompanying client program to implement three 
 * gaze-assisting features:
 * 
 * *** 1: QuickTool, a gaze-triggered popup that allows the user to select their
 *        next tool with gaze,
 * *** 2: X-Ray, providing the user a circular window a selected underlying layer, 
 *        the position of which is selected with the eyes,
 * *** 3: Privacy Shield, dimming and blocking the current art board from view when 
 *        looking away from the screen.
 * 
 * This project was completed for the HCI Project (INFO90008) at the University of Melbourne.
 */
var port = 8898;

// Keep track of active feature
var QUICK_TOOL = 0;
var XRAY = 1;
var PRIVACY_SHIELD = 2;
var activeFeature = XRAY;

// the dimensions of the screen, initialised from the GazeHelpServer
var screenDimensions = {
  width: 0,
  height: 0,
  scaleFactor: 0
}

/**
 * Initialise the screen dimensions at start
 */
function setScreenDimensions(width, height, scaleFactor) {
  screenDimensions.width = Number(width);
  screenDimensions.height = Number(height);
  screenDimensions.scaleFactor = Number(scaleFactor);

  //Initialise popup location
  popupLoc.x = width - (popupLoc.width * scaleFactor);
  popupLoc.y = 0;
  popupLoc.height = height / scaleFactor;

  // Initialise trigger location
  triggerLoc.width = triggerSizes.medium.width;
  triggerLoc.height = triggerSizes.medium.height;
  triggerLoc.x = width - (triggerLoc.width * scaleFactor);
  triggerLoc.y = height - (triggerLoc.height * scaleFactor);
}

function getActiveFeature() { return activeFeature; }
function getPort() { return port; }


/***************************************************************************************
 *
 *                                  QuickTool Trigger
 *
 **************************************************************************************/

var TRIGGERKEY_NAME = "Space";
var popupWindow;
var triggerIsOpen = false;
var triggerLoc = {
  x: 0,
  y: 0,
  width: 0,
  height: 0,
  cornerIndex: 3,
  sizeIndex: 1,
  isNew: false
}

/**
 * Opens the trigger for the QuickTool panel
 */
function openTrigger() {

  if (!triggerIsOpen) {
    popupWindow = new Window("dialog", undefined, undefined, {borderless: true}); //closeButton: false only for Bridge
    popupWindow.preferredSize.width = 0; 
    popupWindow.preferredSize.height = 0; 
    popupWindow.orientation = "column";
    popupWindow.spacing = 0;
    popupWindow.margins = 0;
    popupWindow.location = {x: -50, y: -50};

    // Enable keyboard listener with an object
    var txt = popupWindow.add("edittext")
    txt.active = true;
  
    // Open popup on space bar
    popupWindow.addEventListener("keydown", function(k) { 
      if (k.keyName === TRIGGERKEY_NAME && !popupIsOpen) { 
        openPopup(); 
      }
    });

    // Close popup on space bar release
    popupWindow.addEventListener("keyup", function(k) { 
      if (k.keyName === TRIGGERKEY_NAME) {
        selectHighlighted();
        closePopup(); 
      }
    });
  
    triggerIsOpen = true;
    popupWindow.show();

    popupWindow.size.width = 0; 
    popupWindow.size.height = 0; 
  }
}

/**
 * Closes the QuickTool trigger
 */
function closeTrigger() {
  popupIsOpen = false;
  triggerIsOpen = false;
  popupWindow.close();
}

/**
 * Update the QuickTool popup with the new gaze point
 */
function updatePopup(y) {

  if (popupIsOpen) {
    updateHighlight(y);
  }
}

/**
 * Send trigger location object as a string, as ExtendScript doesn't transfer objects
 */
function getTriggerLoc() { 
  
  // Only perform once applied
  if (!triggerLoc.isNew) {
    return "";
  }
  triggerLoc.isNew = false;

  return triggerLoc.x.toString() + "," 
         + triggerLoc.y.toString() + ","
         + triggerLoc.width.toString() + ","
         + triggerLoc.height.toString() + ",";
}

// sizes the trigger can be
var triggerSizes = {
  small: {
    title: "Small",
    width: 200,
    height: 120
  },
  medium: {
    title: "Medium",
    width: 300,
    height: 180
  },
  large: {
    title: "Large",
    width: 400,
    height: 220
  }
}

// corners the trigger can be in
var triggerCorners = {
  topLeft: {
    title: "Top Left",
    x: 0,
    y: 0
  },
  topRight: {
    title: "Top Right",
    x: (screenDimensions.width - triggerLoc.width * screenDimensions.scaleFactor),
    y: 0
  },
  bottomLeft: {
    title: "Bottom Left",
    x: 0,
    y: (screenDimensions.height - triggerLoc.height * screenDimensions.scaleFactor),
  },
  bottomRight: {
    title: "Bottom Right",
    x: (screenDimensions.width - triggerLoc.width * screenDimensions.scaleFactor),
    y: (screenDimensions.height - triggerLoc.height * screenDimensions.scaleFactor)
  }
}

