  /**
   * Returns the array of tools that are currently active
   */
function getActiveTools() {

  var i;
  var acc = [];
  for (i=0; i<tools.length; i++) {
    if (tools[i].isActive) {
      acc.push(tools[i]);
    }
  }
  return acc;
}

/**
 * Sets the active tool
 */
function setTool(newTool) {
  app.currentTool = newTool;
}

/**
 * Returns the status of the QuickTool popup, whether it's open or triggered
 */
function getStatus() {
  if (popupIsOpen) {
    return 'open';
  }
  if (triggerIsOpen) {
    return 'triggered';
  }
  return 'closed';
}

/***************************************************************************************
 *
 *                                QuickTool Popup Window
 *
 **************************************************************************************/

var highlightedButton = 0;
var popupIsOpen = false;
var popupLoc = {
  x: 0,
  y: 0,
  width: 300,
  height: 800,
  alignIndex: 1,
  widthIndex: 1
};

/**
 * Opens the popup window of the QuickTool panel, after being triggered
 */
function openPopup() {
  
  popupWindow.size.width = popupLoc.width; 
  popupWindow.size.height = popupLoc.height;
  popupWindow.location = {x: popupLoc.x, y: popupLoc.y};

  var activeTools = getActiveTools();
  var numActiveTools = activeTools.length;

  //Create buttons
  var i;
  for (i = 0; i < numActiveTools; i++) {
    activeTools[i].b = popupWindow.add("iconbutton", undefined, File.decode(activeTools[i].imgString), {name: activeTools[i].title, style: "toolbutton"});
    activeTools[i].b.helpTip = activeTools[i].title;
    activeTools[i].y = popupLoc.y + (popupLoc.height / numActiveTools) * (i+1) * screenDimensions.scaleFactor; // the bottom of the button
    activeTools[i].b.preferredSize.width = popupLoc.width;
    activeTools[i].b.preferredSize.height = popupLoc.height / numActiveTools;
    activeTools[i].b.dim = [popupLoc.width, (popupLoc.height / numActiveTools)]; // dimensions of the buttons

    // draw contents of button
    activeTools[i].b.fillBrush = activeTools[i].b.graphics.newBrush(activeTools[i].b.graphics.BrushType.SOLID_COLOR, [0, 0, 0, 0.2]);
    activeTools[i].b.onDraw = customDraw;
    function customDraw() {
      
      with(this) {
        graphics.drawOSControl();
        graphics.drawImage(this.image, (dim[0]/2 - this.image.size[0]/2), (dim[1]/2 - this.image.size[1]/2));
        graphics.rectPath(0, 0, dim[0], dim[1]);
        graphics.fillPath(fillBrush);
      }
    }

    // set the tool on click
    activeTools[i].b.onClick = function(code) {
      return function() {
        
        if (code == "cancel") {
          closePopup();
        } else {
          setTool(code);
        }
      }
    } (activeTools[i].code);
  }
  popupWindow.layout.layout(true);

  popupIsOpen = true;
}

/**
 * Closes the QuickTool popup panel
 */
function closePopup() {
  popupIsOpen = false;
  triggerIsOpen = false;
  popupWindow.close();
}

/**
 *  Selects the highlighted button
 */
function selectHighlighted(k) {
  getActiveTools()[highlightedButton].b.notify("onClick"); //select the currently highlighted button
  closePopup();
}

/**
 * Highlights the button that the user's looking at
 */
function updateHighlight(y) {
  
  var activeTools = getActiveTools();

  // find which area the gazepoint is in
  var i;
  for (i = 0; i < activeTools.length; i++) {
    
    if (y < activeTools[i].y) {
      highlightButton(i)
      break;
    }

    // highlight bottom button
    if (i == activeTools.length - 1) {
      highlightButton(i);
    }
  }
}

/**
 * Highlights the i-th button
 */
function highlightButton(i) {
  
  var activeTools = getActiveTools();
  
  if (i >= activeTools.length | i < 0) {
    return;
  }

  // Change the button's colour
  if (highlightedButton != i) {
    activeTools[i].b.fillBrush = activeTools[i].b.graphics.newBrush(activeTools[i].b.graphics.BrushType.SOLID_COLOR, [1, 1, 1, 0.2]);
    activeTools[i].b.notify("onDraw");

    // reset previously highlighted button
    activeTools[highlightedButton].b.fillBrush = activeTools[highlightedButton].b.graphics.newBrush(activeTools[highlightedButton].b.graphics.BrushType.SOLID_COLOR, [0, 0, 0, 0.2]);
    activeTools[highlightedButton].b.notify("onDraw");
    highlightedButton = i;
  }
}

