/***************************************************************************************
 *
 *                                   X Ray Vision
 *
 **************************************************************************************/

var xrayDiameter = 200; // default diameter of the X-Ray circle
var createdMasks = false;
var selectedLayerIndex = 0;
var xCoord = 0;
var yCoord = 0;
var createdMasks = false;
var createdCrosshairs = false;
var crosshairsLayer;

/**
 * Sets up to start the crosshairs
 */
function startCrosshairs() {
  clearXray();
  setZoom(100); // make full screen to scale gaze point
}

/**
 * Sets the crosshairs to be at the gaze point (x, y coordinates)
 */
function updateCrosshairs(x, y) {

  if (app.documents.length > 0) {
    
    // shift the coordinate to fit the canvas
    var topLeftX = (screenDimensions.width)/2 - app.activeDocument.width.value/2 - 240;
    var topLeftY = (screenDimensions.height)/2 - app.activeDocument.height.value/2 + 40;

    xCoord = Number(x) - topLeftX;
    yCoord = Number(y) - topLeftY;
  
    removeCrosshairs();
    createCrosshairs();
  }
}

/**
 * Creates the crosshairs object at the coordinates
 */
function createCrosshairs() {
  
  if (app.documents.length > 0) {
    var docRef = app.activeDocument;
    var lineArray = new Array();
    var coord;

    for (var i=0; i<=8; i++) {
      coord = getCoordinate(i);
      lineArray[i] = new PathPointInfo;
      lineArray[i].kind = PointKind.CORNERPOINT;
      lineArray[i].anchor = Array(coord[0], coord[1]);
      lineArray[i].leftDirection = lineArray[i].anchor;
      lineArray[i].rightDirection = lineArray[i].anchor;
    }
    
    var lineSubPathArray = new Array();
        lineSubPathArray[0] = new SubPathInfo();
        lineSubPathArray[0].operation = ShapeOperation.SHAPEXOR;
        lineSubPathArray[0].closed = false;
        lineSubPathArray[0].entireSubPath = lineArray;

    docRef.pathItems.add("crosshairs", lineSubPathArray);
    //myPathItem.strokePath(ToolType.BRUSH);

    createdCrosshairs = true;
  }
}

/**
 * Returns the coordinates for each of the points making up the crosshairs
 */
function getCoordinate(n) {
  
  var r = xrayDiameter/2;
  var x;
  var y;

  switch(n) {
    case 0: //right hand side
      x = xCoord + r;
      y = yCoord;
      break;
    case 1:
      x = xCoord + 0.707 * r;
      y = yCoord - 0.707 * r;
      break;
    case 2:
      x = xCoord;
      y = yCoord - r;
      break;
    case 3:
      x = xCoord - 0.707 * r;
      y = yCoord - 0.707 * r;
      break;
    case 4:
      x = xCoord - r;
      y = yCoord;
      break;
    case 5:
      x = xCoord - 0.707 * r;
      y = yCoord + 0.707 * r;
      break;
    case 6:
      x = xCoord;
      y = yCoord + r;
      break;
    case 7:
      x = xCoord + 0.707 * r;
      y = yCoord + 0.707 * r;
      break;
    case 8:
      x = xCoord + r;
      y = yCoord;
      break;
  }
  
  return [x, y];
}

/**
 * Removes the crosshairs object from the document
 */
function removeCrosshairs() {
  
  if (app.documents.length > 0) {
    try {
      app.activeDocument.pathItems.getByName("crosshairs").remove();
      createdCrosshairs = false;
    } catch (e) {}
  }
}

/**
 * Activates the actual X-Ray circle at the gaze point coordinates
 */
function activateXray() {

  //delete crosshairs
  removeCrosshairs();

  // make sure document is open
  if (app.documents.length > 0) {
    var docRef = app.activeDocument;
    var layerCount = docRef.layers.length;
    var prevActiveLayer = docRef.activeLayer;
    var reachedSelected = false;

    // Add mask to all new layers
    for (var i=0; i<layerCount; i++) {
      docRef.activeLayer = docRef.layers[i];

      // Stop when current layer reached
      if (reachedSelected || docRef.activeLayer.name == prevActiveLayer.name) {
        if (!createdMasks) { break; }
        deleteMask();
        selectedLayerIndex = i;
        reachedSelected = true;
      }
      
      else if (!docRef.activeLayer.isBackgroundLayer){
        try{
          createNewMask();
          placeMaskCircle(xCoord, yCoord, xrayDiameter);
        } catch(e) {}
      }
    }

    //reset the layer
    docRef.activeLayer = prevActiveLayer;
    if (docRef.activeLayer.isBackgroundLayer) {} // access it so it actually changes
    createdMasks = true;
  }
}
