  var idMd = charIDToTypeID( "Md  " );
  var idBlnM = charIDToTypeID( "BlnM" );
  var idNrml = charIDToTypeID( "Nrml" );
  desc23.putEnumerated( idMd, idBlnM, idNrml );
  executeAction( idFl, desc23, DialogModes.NO );

  // clear selection
  var idsetd = charIDToTypeID( "setd" );
  var desc190 = new ActionDescriptor();
  var idnull = charIDToTypeID( "null" );
  var ref85 = new ActionReference();
  var idChnl = charIDToTypeID( "Chnl" );
  var idfsel = charIDToTypeID( "fsel" );
  ref85.putProperty( idChnl, idfsel );
  desc190.putReference( idnull, ref85 );
  var idT = charIDToTypeID( "T   " );
