/**
 * Set the document's zoom level
 */
function setZoom(zoom) {
  
  if (app.documents.length > 0) {
    cTID = function(s) { return app.charIDToTypeID(s); };
    var docRes = activeDocument.resolution;
    activeDocument.resizeImage( undefined, undefined, 72/(zoom/100), ResampleMethod.NONE );
    var desc = new ActionDescriptor();
    var ref = new ActionReference();
    ref.putEnumerated( cTID( "Mn  " ), cTID( "MnIt" ), cTID( 'PrnS' ) );
    desc.putReference( cTID( "null" ), ref );
    executeAction( cTID( "slct" ), desc, DialogModes.NO );
    activeDocument.resizeImage( undefined, undefined, docRes, ResampleMethod.NONE );
  }
}

/**
 * Clears all X-Ray circle masks off each layer
 */
function clearXray() {
  
  // clear it
  if (app.documents.length > 0) {

    var docRef = app.activeDocument;
    var prevActiveLayer = docRef.activeLayer;
    var layerCount = docRef.layers.length;

    for (var i=0; i<layerCount; i++) {
      docRef.activeLayer = docRef.layers[i];
      deleteMask();
    }
    createdMasks = false;

    docRef.activeLayer = prevActiveLayer;
    if (docRef.activeLayer.isBackgroundLayer) {} // access it so it actually changes
  }
}

