var PRIVACY_LAYER_NAME = "Privacy Layer";
var privacyLayer;
var isPrivacyLayerCreated = false;

/**
 * Activates the privacy shield, with full coverage
 */
function activatePrivacyShield() {
  createPrivacyLayer();
  privacyLayer.fillOpacity = 100;
}

/**
 * Activates the privacy shield, as a transparent or full coverage layer
 */
function activatePrivacyScreen() {
  
  if (glanceSelection == DOES_NOTHING) {
    return;
  }
  createPrivacyLayer();

  if (glanceSelection == DARKEN_SCREEN) {
    privacyLayer.fillOpacity = 70;
  } else {
    privacyLayer.fillOpacity = 100;
  }
}

/**
 * Creates the privacy layer itself over the top
 */
function createPrivacyLayer() {
  
  if (!isPrivacyLayerCreated) {
    privacyLayer = activeDocument.artLayers.add();
    privacyLayer.name = PRIVACY_LAYER_NAME;
  
    activeDocument.activeLayer = privacyLayer;
  
    var myColor = new SolidColor();  
    myColor.rgb.red = 40;  
    myColor.rgb.green = 40;  
    myColor.rgb.blue = 40;
  
    activeDocument.selection.fill(myColor);
    isPrivacyLayerCreated = true;
  }
}

/**
 * Removes the privacy layer
 */
function deactivatePrivacy() {
  activeDocument.artLayers.getByName(PRIVACY_LAYER_NAME).remove();
  isPrivacyLayerCreated = false;
}


