var toolTabNames = ['Move','Marquee','Lasso','Selection','Crop','Frame','Eyedropper','Healing','Brush','Stamp','History','Eraser','Gradient','Blur','Dodge','Pen','Type','Shape','Zoom'];

/**
 * Renders the quicktool tool selection settings in the quicktool tab
 */
function renderQuickToolToolsSettings(quickToolGroup) {
  var toolsGroup = quickToolGroup.add("group", undefined, {name: "toolsGroup"}); 
  toolsGroup.preferredSize.width = 210; 
  toolsGroup.orientation = "column"; 
  toolsGroup.alignChildren = ["left","center"]; 
  toolsGroup.spacing = 10; 
  toolsGroup.margins = 5; 

  var toolsTitle = toolsGroup.add("statictext", undefined, undefined, {name: "toolsTitle"}); 
  toolsTitle.text = "Tools on Popup";
  toolsTitle.graphics.font = "Tahoma-Bold:16";

  // TOOLS PANEL
  var toolsPanel = toolsGroup.add("group", undefined, undefined, {name: "toolsPanel"}); 
  toolsPanel.alignChildren = ["left","fill"]; 
  toolsPanel_nav = toolsPanel.add ("listbox", undefined, toolTabNames); 
  toolsPanel_nav.preferredSize = [100, 330];
  var toolsPanel_innerwrap = toolsPanel.add("group");
  toolsPanel_innerwrap.alignment = ["fill","fill"]; 
  toolsPanel_innerwrap.orientation = ["stack"]; 


  var currTabName = "";
  var currTab = null;
  var toolsPanel_tabs = [];

  // Put all tools into the panel
  for (var j=0; j<tools.length; j++) {
    
    // Create a new tab if the tab name has changed
    if (tools[j].tab !== currTabName) {
      var newTab = toolsPanel_innerwrap.add("group", undefined, {name: (tools[j].tab + "Tab")});
      newTab.graphics.font = "Tahoma:12";
      newTab.text = tools[j].tab; 
      newTab.orientation = "column"; 
      newTab.alignChildren = ["fill","top"]; 
      newTab.spacing = 10; 
      newTab.margins = 0;
      newTab.alignment = ["fill","fill"]; 
      newTab.visible = false; 

      currTab = newTab;
      currTabName = tools[j].tab;
      toolsPanel_tabs.push(currTab);
    }

    tools[j].chk = currTab.add("checkbox", undefined, undefined, {name: (tools[j].code + "Chk")}); 
    tools[j].chk.text = tools[j].title;
    tools[j].chk.value = tools[j].isActive;
  }

  toolsPanel_nav.onChange = showTab_toolsPanel;
  toolsPanel_nav.selection = 0;
  showTab_toolsPanel();

  function showTab_toolsPanel() { 
    if ( toolsPanel_nav.selection !== null ) { 
      for (var i = toolsPanel_tabs.length-1; i >= 0; i--) { 
        toolsPanel_tabs[i].visible = false; 
      } 
      toolsPanel_tabs[toolsPanel_nav.selection.index].visible = true; 
    } 
  } 
}

